import React from 'react';
// import Home from '../Home';
// import Presentation from '../Presentation';
// import Projects from '../Projects';
// import Skills from '../Skills';
// import Experience from './components/Experience';
import "../styles/main.css";

const Main = () => {
  return (
    <>
        <header>
          <nav>
            <ul>
              <li><a href="#home">Accueil</a></li>
              <li><a href="#about">À propos</a></li>
              <li><a href="#projects">Projets</a></li>
              <li><a href="#contact">Contact</a></li>
            </ul>
          </nav>
        </header>
        <section id="home">
          <div class="intro">
            <div class="intro-content">
              <h1>Bienvenue sur mon Portfolio</h1>
              <p>Je suis un développeur passionné.</p>
            </div>
            <div class="profile-image">
              <img src="path/to/profile-image.jpg" alt="Ma photo de profil"></img>
            </div>
          </div>
        </section>

        <section id="about">
          <h2>À propos de moi</h2>
          <p>Je suis un développeur talentueux avec une expertise dans les technologies web modernes. J'ai une passion pour la création d'applications innovantes et la résolution de problèmes complexes.</p>
        </section>

        <section id="projects">
          <h2>Mes Projets</h2>
          <div class="project">
            <h3>Projet 1</h3>
            <p>Description du projet 1.</p>
          </div>
          <div class="project">
            <h3>Projet 2</h3>
            <p>Description du projet 2.</p>
          </div>
        </section>


      <footer>
        <p>&copy; 2023 Mon Portfolio. Tous droits réservés.</p>
      </footer>
    </>
  );
};

export default Main;
